import withRouterHooks from 'helpers/withRouterHooks';
import React from 'react';
import { Link } from 'react-router-dom';
import HeaderLarge from 'views/components/display/HeaderLarge';

class PageExpired extends React.Component {
  render() {
    return (
      <>
        <HeaderLarge displayName={"Your session expired"} />

        <p><Link to={"/" + this.props.params.form + "/Description"} />Return to FormName</p>
      </>
    );
  }
}

export default withRouterHooks(PageExpired)
